import styles from '../styles/BackgroundGalaxy.module.scss'

function BackgroundGalaxy(){
  return(
    <div id="large-header" className={styles.largeHeader}>
      <canvas id="demo-canvas"></canvas>
      <h1 className="main-title">Connect <span className="thin">Three</span></h1>
    </div>
  )
}

export default BackgroundGalaxy
